  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      font-size: 14px;
      font-family: sans-serif;
      font-size: 101.62% !important;
      line-height: 142.13% !important;
    }

    html {
      color-scheme: light dark
    }

    body {
      font-family: Arial, 'Helvetica Neue', Helvetica, sans-serif;
      overflow: hidden;
      font-size: 18px;
      color: #000;
      width: 100%;
      max-width: 600px;
      margin: 0 auto
    }

    img {
      max-width: 100%
    }

    .header {
      background: #161616;
      padding: 0 10px
    }

    .header__wrapper {
      height: 40px;
      display: flex;
      align-items: center;
      justify-content: space-between
    }

    .header__logo {
      font-weight: 700;
      font-size: 1.5rem;
      text-align: center;
      letter-spacing: .5px;
      color: #fff
    }

    .header__logo span {
      color: #da1300;
      font-size: inherit
    }

    .main__info {
      text-align: center;
      font-size: 13px;
      color: #000;
      padding: 10px 5px;
      text-overflow: ellipsis;
      font-weight: 600
    }

    .main__info span {
      color: #de2600
    }

    .main__wrapper {
      width: 100%;
      margin: 0 auto;
      display: flex;
      flex-direction: column;
      min-height: calc(100vh - 40px)
    }

    .main__item {
      margin-bottom: 10px;
      flex: 1 1 auto;
      display: flex;
      flex-direction: column
    }

    .main__item .image {
      display: block;
      width: 100%;
      filter: blur(30px);
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      min-height: 100%;
      min-width: 100%
    }

    .item__image {
      overflow: hidden;
      position: relative;
      flex: 1 1 auto;
      min-height: 250px
    }

    .item__time {
      position: absolute;
      bottom: 8px;
      right: 12px;
      background: rgba(27, 27, 27, .8);
      color: #c6c6c6;
      padding: 2px 6px;
      border-radius: 2px;
      font-size: 16px
    }

    .item__content {
      padding: 10px;
      position: relative
    }

    .item__title {
      color: #000;
      font-size: 16px;
      text-align: center;
      margin-bottom: 4px
    }

    .item__info {
      display: flex;
      align-items: center;
      justify-content: center
    }

    .item__channel-name {
      text-decoration: underline;
      color: #555;
      font-size: 15px
    }

    .item__views {
      color: #555;
      margin: 0 4px;
      font-size: 15px
    }

    .item__views:after,
    .item__views:before {
      content: '-';
      margin: 0 4px;
      text-decoration: none
    }

    .item__duration {
      font-size: 13px;
      padding: 2px 5px;
      background: #777;
      color: #fff;
      border-radius: 3px
    }

    .pl {
      display: flex;
      flex-grow: 1;
      margin-top: 10px;
      min-height: 212px;
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      z-index: 2
    }

    .pl__cnt {
      background-size: contain;
      background-position: center center;
      background-repeat: no-repeat;
      flex-grow: 1
    }

    .pl__cnt {
      align-items: center;
      display: flex;
      justify-content: center;
      position: relative
    }

    .pl__ctr {
      align-items: center;
      bottom: 0;
      display: flex;
      height: 50px;
      position: absolute;
      width: 100%
    }

    .pl__ctr-tm {
      font-size: 11px;
      margin: 0 20px 0 15px
    }

    .pl__ctr-bar {
      background-color: #3f3f3f;
      flex-grow: 1;
      height: 2px;
      margin-right: 15px;
      position: relative
    }

    .pl__ctr-bar:before {
      background-color: #fff;
      border-radius: 50%;
      content: '';
      cursor: pointer;
      height: 16px;
      left: -8px;
      position: absolute;
      top: -8px;
      width: 16px;
      z-index: 1
    }

    .pl__ctr-bar-line {
      -webkit-animation: a 5s both;
      animation: a 5s both;
      background-color: #9f9f9f;
      height: 100%;
      left: 0;
      position: absolute;
      transform-origin: left;
      width: 85%
    }

    .pl__ctr-ic {
      cursor: pointer;
      fill: #fff
    }

    .pl__ctr-ic.hd {
      background-color: #000;
      border-radius: 4px;
      fill: #b6d4f0;
      height: 16px;
      width: 33px
    }

    .pl__ctr-ic.mute {
      height: 14px;
      margin: 0 15px
    }

    .pl__ctr-ic.resize {
      height: 18px;
      margin-right: 15px
    }

    .lst__t {
      font-size: large;
      font-weight: 700;
      padding: 0 10px
    }

    .lst__w-i {
      display: flex
    }

    .lst__i {
      background: #292929;
      border-radius: 4px;
      margin: 5px;
      padding: 7px;
      width: 100%;
      overflow: hidden
